import postmates from './images/postmates.jpg'
import doordash from './images/doordash.jpg'

const appsData = [
    {
        id: 1,
        name: "Postmates",
        logo: postmates
    },
    {
        id: 1,
        name: "UberEats",
        logo: postmates
    },
    {
        id: 1,
        name: "DoorDash",
        logo: doordash
    },
    {
        id: 1,
        name: "GrubHub",
        logo: postmates
    }
]

export default appsData
